function [C] = carbuilder()
%Function of this script is to get the parameters

% Chassis parameters

CarCG = [27.225	0	9.1428]; % x y z (mm)
Wheelbase = 60.5; % mm
TrackWidth = [49 49]; % Front Back (mm)
DriverWeight = 70; % kg
DriverCG = [27.225	0	9.1428]; % x y z (mm)
CarWeight =  560; % Kg
% Suspension Parameters

SpringRate = [300 300]; % Front Rear (N/mm)
ARBRate = [300 0]; % Front Rear (in N/deg)
UnsprungW = [41 41]; % Front  (Kg)
UnsprungH = [9 9]; % unsprung cg height  (mm)
RollCenter = [0.48 1.7]; % Front Back (mm)
PitchCenter = [10 30]; % Height Distance from back (mm)

%"Carsuspension" to store all the suspension parameters in one object
Suspension = CarSuspension(SpringRate,ARBRate,UnsprungW,UnsprungH,RollCenter,PitchCenter);

% Tire Parameters

K = 900; % N/mm
R = 10.5; % mm
RollingResistance = 0.03;
J_t = 120.6280; % Kg m2
Gripfactor = 0.88;
TireModel = @Hoosier13;
%"CarTire" to store all the suspension parameters in one object
Tire = CarTire(TireModel,K,R,RollingResistance,J_t,Gripfactor);

% Brake Parameters
J_b = 0.9670; % Kg m2
Brakes = CarBrakes(J_b);

% Aero Parameters
Drag = 0.7;
Lift = -1.20;
CrossArea =2015;  % m^2
rho = 0.0023;
cop = [31.7 0 10];

%% MOtor

Efficiency = 0.9;
PeakTorque = 240; % Nm
PowerLimit = 80 * Efficiency; % kW
RPMLimit = 5500;
PowerScaler = 1 / 9549; % Nm * RPM * PowerScaler = kW

RPMS = (0:RPMLimit)';
Torque = ones(RPMLimit + 1, 1) * PeakTorque;

for i = 1:RPMLimit+1
    if Torque(i) * RPMS(i) * PowerScaler > PowerLimit
        Torque(i) = PowerLimit / (RPMS(i) * PowerScaler);
    end
end

Torque(RPMLimit+1) = 0;
EfficiencyCurve = ones(length(RPMS),1)*Efficiency;
OutputCurve = [RPMS,Torque,EfficiencyCurve];
NMotors = 1;%% Doesnt matter
Motor = CarMotor(OutputCurve,NMotors);

%% Battery Parameters

Capacity = 6.5; % kWh
NominalVoltage = 262.2; % V
Resistance = 0.16; % ohms
RoundtripEfficiency = 0.9;
Battery = CarBattery(Capacity,Resistance,NominalVoltage,RoundtripEfficiency);

%% Driveline

Efficiency = 0.95;
J_d = 20; % 
Tmult = 1; % torque multiplier
GearRatios = 3.5;
FinalDrive = 1;
FinalDriveRatio = Tmult*GearRatios*FinalDrive;
Driveline = CarDriveline(GearRatios,Efficiency,J_d,FinalDriveRatio,Motor.OutputCurve);

%% Car Parameters

C = Car(Brakes,Driveline,Motor,Battery,Suspension,Tire,CrossArea,Lift,Drag,rho,cop,CarWeight,CarCG,DriverWeight,DriverCG,TrackWidth,Wheelbase);
C.BrakingMode = 'Hydraulic';

%% Tire property

function [ Force,Slip ] = Hoosier13( Normal,LongLat )
% These equations of based of curve fits of Hoosier R25B 13x7 tire data.
% * Fit is based on tire normal loads from 0-350lbs and is only an
%   extrapolation beyond that.
% * Optimum Slip Angles/Ratios were used to find the ouput force and are
%   returned. Returned Slip Angle may be inaccurate at normal loads < 50 lbs.
% * An Inclination Angle of 0 was also used.
% * Source Data:
%       Longitudinal: https://docs.google.com/spreadsheets/d/1GGr0C9T5nTWj2hsEe3SVV6OE34LaEc_uqaYXwbKgMGM/edit?usp=sharing
%       Lateral: https://docs.google.com/spreadsheets/d/1Gx2vhS-jnTdLmaWeMJVq3nm5NF3w7Ltedh8BYTxcZX4/edit?usp=sharing

if strcmp(LongLat,'Lateral')
    Force = -0.001835 * Normal .^ 2 + 2.014 * Normal + -0.002824;
    Slip = 2.51e-13 * Normal .^ 5 + -9.44e-11 * Normal .^ 4 + -9.74e-08 * Normal .^ 3 + 6.824e-5 * Normal .^ 2 + -0.003949 * Normal + 3.371;
elseif strcmp(LongLat,'Longitudinal')
    Force = -0.001004 * Normal .^ 2 + 1.801 * Normal + .08458;
    Slip = 3.913e-08 * Normal .^ 3 + 4.941e-06 * Normal .^ 2 + .0003835 * Normal + 3.719;       
else
    Force = [];
    Slip = [];
end

% Handle normal loads of 0 or below.
Force(Normal <= 0) = 0.0;
Slip(Normal <= 0) = 0.0;

end

